const DetailsInfo = (props) => {
   

    return ( 
        <div className="details-info">
        <h1>{props.detailsTitle} </h1>
              {
                    props.details.map( (detail) => (
                    <div className="info" key={detail.id}>
                        <h2>{props.infos}{detail.completeName}</h2>
                    </div>
             ))}
        </div>
     );
}
 
export default DetailsInfo;
